subSubSection.paragraph:
Thallus dark except for cell I and, sometimes, cell V. Cell V obtriangular, small, half or less of the length of cell IV, not connected with cell III. Outer appendage unbranched, with the lower cells (including the basal cell) variably darkened, especially towards the dorsal margin. Inner appendage consisting of two branches directly arising from the basal cell, terminated by solitary or a cluster of slender antheridia (
Fig. 38F
, an). [Detailed descriptions: 
Weir 1994
; 
Majewski 1994b
; 
Santamaria 1998
]

